class Pokemon {
    constructor(name, vitesse, hp, attaqueP, attaqueS, defenseP, defenseS, level) {
        this.name = name;
        this.vitesse = vitesse;
        this.hp = hp;
        this.attaqueP = attaqueP;
        this.attaqueS = attaqueS;
        this.defenseP = defenseP;
        this.defenseS = defenseS;
        this.level = level;
    }
}
